import React, { useState } from "react";


const App = () => {
  const st = { backgroundColor : "violet"};
  const textv = 'click me';

  const [bg,setbg] = useState(st);

  const [textc,setv] = useState(textv);

  const bgChanges = () => {
    const st = { backgroundColor : "222167"};
    setbg(st);
    const vlaue = "oooch";
    setv(vlaue);
  }
 return (
   <>
   <div style = { bg }>
     <button onClick = {bgChanges} >{ textc }</button>
   </div>
   </>
 )
}

export default App;
